/* qpsol:(h[167x167,0nz],g[167],a[166x167,814nz],lba[166],uba[166],lbx[167],ubx[167],x0[167],lam_x0[167],lam_a0[166],q[],p[])->(x[167],cost,lam_a[166],lam_x[167]) */
static int casadi_f10(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  OSQPWorkspace *work=casadi_f10_mem[mem];
  casadi_int i, n, offset;
  /* Set objective */
  if (arg[1]) {
    casadi_copy(arg[1], 167, w);
  } else {
    casadi_clear(w, 167);
  }
  if (osqp_update_lin_cost(work, w)) return 1;
  /* Set bounds */
  if (arg[5]) {
    casadi_copy(arg[5], 167, w);
  } else {
    casadi_fill(w, 167, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 166, w+167);
  } else {
    casadi_fill(w+167, 166, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 167, w+333);
  } else {
    casadi_fill(w+333, 167, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 166, w+500);
  } else {
    casadi_fill(w+500, 166, casadi_inf);
  }
  if (osqp_update_bounds(work, w, w+333)) return 1;
  /* Project Hessian */
  casadi_tri_project(arg[0], casadi_s17, w, 0);/* Get constraint matrix */
  offset = 0;
  for (i=0; i< 167; ++i) {
    w[0+offset] = 1;
    offset++;
    n = casadi_s18[i+1]-casadi_s18[i];
    casadi_copy(arg[2]+casadi_s18[i], n, w+offset+0);
    offset+= n;
  }
  /* Pass Hessian and constraint matrices */
  if (osqp_update_P_A(work, w, 0, 0, w+0, 0, 981)) return 1;
  if (osqp_warm_start_x(work, arg[7])) return 1;
  if (arg[8]) {
    casadi_copy(arg[8], 167, w);
  } else {
    casadi_clear(w, 167);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 166, w+167);
  } else {
    casadi_clear(w+167, 166);
  }
  if (osqp_warm_start_y(work, w)) return 1;
  if (osqp_solve(work)) return 1;
  if (res[1]) casadi_copy(&work->info->obj_val, 1, res[1]);
  if (res[0]) casadi_copy(work->solution->x, 167, res[0]);
  if (res[3]) casadi_copy(work->solution->y, 167, res[3]);
  if (res[2]) casadi_copy(work->solution->y+167, 166, res[2]);
  if (work->info->status_val != OSQP_SOLVED) return 1;
  return 0;
}

